function elimina(key) {
    $("#row_" + key).remove();

    var commentsRef = firebase.database().ref('guide/');
    firebase.database().ref('removeGuide/' + key).set({
        eliminado: key
    });

    firebase.database().ref('guide/' + key).remove();
}

function table() {
    var commentsRef = firebase.database().ref('guide/');
    commentsRef.on('child_added', function (data) {
        drawTable(data.val().id, data.val().fecha_i, data.val().remit_nom, data.val().remit_domicilio, data.val().remit_tel, data.val().dest_nom, data.val().dest_domicilio, data.val().dest_tel, data.key);
    });
    commentsRef.on('child_changed', function (data) {
        $("#row_" + data.key).remove();
        drawTable(data.val().id, data.val().fecha_i, data.val().remit_nom, data.val().remit_domicilio, data.val().remit_tel, data.val().dest_nom, data.val().dest_domicilio, data.val().dest_tel, data.key);

    });
}

function status(key) {
    var txtStatus = null;
    var ref = firebase.database().ref("guide/" + key + "/");
    ref.on("value", function (snapshot) {
        var camino = snapshot.child("camino").exists();
        var entrega = snapshot.child("entregado").exists();
        if (entrega) {
            txtStatus = "entregado";
        } else if (camino) {
            txtStatus = "en camino";
        } else {
            txtStatus = "documentado";
        }

    });
    return txtStatus;
}


function drawTable(id, fecha, remit_nom, remit_domicilio, remit_tel, dest_nom, dest_domicilio, dest_tel, key) {
    var html =
        '<td>' + id + '</td>' +
        '<td>' + fecha + '</td>' +
        '<td>' + remit_nom + '</td>' +
        '<td>' + remit_domicilio + '</td>' +
        '<td>' + remit_tel + '</td>' +
        '<td>' + dest_nom + '</td>' +
        '<td>' + dest_domicilio + '</td>' +
        '<td>' + dest_tel + '</td>' +
        '<td >' + status(key) + '</td>' +
        '<td>' + '<div class="ui small basic icon buttons">' +
        '<button class=" ui button" onclick="elimina(this.id)" id="' + key + '"><i class="remove icon"></i></button>' +
        '<button class=" ui  button" onclick="showData(this.id)" id="' + key + '"><i class="write icon"></i></button>' +
        '<button class=" ui  button" onclick="print(this.id)" id="' + key + '"><i class="print icon"></i></button>' +
        '</div>' +
        '</td>';
    var table = document.getElementById('table');
    var newUser = document.createElement('tr');
    newUser.setAttribute("id", "row_" + key);
    newUser.innerHTML = html;
    var postElement = table.appendChild(newUser);

}

