function plugins(key) {
    $("#attachmentName").on("change", function (evt) {
        file = evt.target.files[0];
    });


    $("#med1" + key).keyup(function () {
        var val1 = $("#med1" + key).val();
        var val2 = $("#med2" + key).val();
        var val3 = $("#med3" + key).val();
        sumkg(val1, val2, val3);
    });
    $("#med2" + key).keyup(function () {
        var val1 = $("#med1" + key).val();
        var val2 = $("#med2" + key).val();
        var val3 = $("#med3" + key).val();
        sumkg(val1, val2, val3);
    });
    $("#med3" + key).keyup(function () {
        var val1 = $("#med1" + key).val();
        var val2 = $("#med2" + key).val();
        var val3 = $("#med3" + key).val();
        sumkg(val1, val2, val3);
    });
    $("#price" + key).keyup(function () {
        var price = $(this).val();
        var total = price * 1.16;
        $("#total" + key).val(parseFloat(total).toFixed(2));
    });

    function sumkg(val1, val2, val3) {
        var suma = 0;
        suma = parseInt(val1) * parseInt(val2) * parseInt(val3);
        if (!isNaN(suma)) {
            var kg = suma / 6000;
            $("#weigth" + key).val(parseInt(kg));
            price(kg);
        }
    }

    function price(kg) {
        var kg = parseInt(kg);
        var price = 0;
        var total = 0;
        if (kg > 2) {
            price = ((kg - 2) * 11.50) + 120
            total = price * 1.16;
            $("#price" + key).val(parseFloat(price).toFixed(2));
            $("#total" + key).val(parseFloat(total).toFixed(2));
        } else if (kg === 2) {
            price = 120;
            total = price * 1.16;
            $("#price" + key).val(parseFloat(price).toFixed(2));
            $("#total").val(parseFloat(total).toFixed(2));
        } else {
            $("#price" + key).val("0.00");
            $("#total" + key).val("0.00");
        }
    }
    var fileExtentionRange = '.png .jpg';
    var MAX_SIZE = 30; // MB

    $(document).on('change', '.btn-file :file', function () {
        var input = $(this);

        if (navigator.appVersion.indexOf("MSIE") != -1) { // IE
            var label = input.val();

            input.trigger('fileselect', [1, label, 0]);
        } else {
            var label = input.val().replace(/\\/g, '/').replace(/.*\//, '');
            var numFiles = input.get(0).files ? input.get(0).files.length : 1;
            var size = input.get(0).files[0].size;

            input.trigger('fileselect', [numFiles, label, size]);
        }
    });

    $('.btn-file :file').on('fileselect', function (event, numFiles, label, size) {
        $('#attachmentName').attr('name', 'attachmentName'); // allow upload.

        var postfix = label.substr(label.lastIndexOf('.'));
        if (fileExtentionRange.indexOf(postfix.toLowerCase()) > -1) {
            if (size > 1024 * 1024 * MAX_SIZE) {
                alert('max size：<strong>' + MAX_SIZE + '</strong> MB.');

                $('#attachmentName').removeAttr('name'); // cancel upload file.
            } else {
                $('#_attachmentName').val(label);
            }
        } else {
            alert('file type：<br/> <strong>' + fileExtentionRange + '</strong>');

            $('#attachmentName').removeAttr('name'); // cancel upload file.
        }
    });
}


